using System;
using System.Collections.Generic;
using System.Diagnostics;
using System.IO;
using System.Linq;
using ClosedXML.Excel;

namespace RelatorioConsolidadoClosedXML
{
    class Program
    {
        static void Main(string[] args)
        {
            List<Relatorio> relatorios = new List<Relatorio>();
            relatorios.Add(new Relatorio("Teste", "Acelera PROJ", "Desenvolvedor de Software", "Senior", 11.316666, 339.799992));
            relatorios.Add(new Relatorio("Teste", "Acelera PROJ", "Desenvolvedor de Software", "Senior", 11.316666, 339.799992));
            relatorios.Add(new Relatorio("Teste", "Acelera PROJ", "Desenvolvedor de Software", "Senior", 11.316666, 339.799992));
            relatorios.Add(new Relatorio("Teste", "Teste PROJ", "Desenvolvedor de Software", "Senior", 11.316666, 339.799992));
            relatorios.Add(new Relatorio("Teste", "Teste PROJ", "Desenvolvedor de Software", "Senior", 11.316666, 339.799992));
            relatorios.Add(new Relatorio("Teste", "Teste PROJ2", "Desenvolvedor de Software", "junior", 11.316666, 339.799992));
            relatorios.Add(new Relatorio("Teste", "Teste PROJ2", "Desenvolvedor de Software", "pleno", 11.316666, 339.799992));

            double projectValue = 0;
            double projectHours = 0;
            double totalValue = 0;

            // Criando a planilha
            IXLWorkbook workbook = new XLWorkbook();
            IXLWorksheet worksheet = workbook.Worksheets.Add("Relatorio");
            //Desabilidanto as Gridlines da worksheet
            worksheet.ShowGridLines = false;
            //Adicionando imagem no Excel
            string imagebase64 = "";
            byte[] data = Convert.FromBase64String(imagebase64);
            using(var stream = new MemoryStream(data,0, data.Length))
            {
                var image = worksheet.AddPicture(stream)
                    .MoveTo(worksheet.Cell(1,1));
                image.Height = 60;
                image.Width = 145;
            }

            var listaProject = relatorios.Select(x => x.Project).Distinct().ToList();

            // Titulo
            worksheet.Cell(2,2).Value = "Relatório Mensal Consolidado";
            worksheet.Cell(2,2).Style.Font.Bold = true;
            var range = worksheet.Range("B2:E2"); //Merge nas celular de C a G
            range.Merge().Style.Font.SetBold().Font.FontSize = 24;
            worksheet.Cell(2,2).Style.Alignment.Horizontal = XLAlignmentHorizontalValues.Center;
            //Subtitulo - Data Do Relatorio
            worksheet.Cell(3,2).SetValue<string>("Desenvolvimento de Projetos Customizados");
            worksheet.Cell(3,2).DataType = XLDataType.Text;
            range = worksheet.Range("B3:E3"); //Merge nas celular de C a G
            worksheet.Cell(3,2).Style.Font.Bold = true;
            range.Merge().Style.Font.SetBold().Font.FontSize = 16;
            worksheet.Cell(3,2).Style.Alignment.Horizontal = XLAlignmentHorizontalValues.Center;

            //Informação sobre Cliente
            worksheet.Cell(6,1).SetValue<string>("Cliente:");
            worksheet.Cell(6,1).Style.Font.Bold = true;
            worksheet.Cell(6,1).Style.Font.FontSize = 16;
            worksheet.Cell(6,1).Style.Alignment.Horizontal = XLAlignmentHorizontalValues.Center;
            worksheet.Cell(6,2).Value = relatorios[0].Client;
            worksheet.Cell(6,2).Style.Font.Bold = true;
            worksheet.Cell(6,2).Style.Font.FontSize = 16;
            //informação sobre Periodo
            worksheet.Cell(7,1).SetValue<string>("Período:");
            worksheet.Cell(7,1).Style.Font.Bold = true;
            worksheet.Cell(7,1).Style.Font.FontSize = 16;
            worksheet.Cell(7,1).Style.Alignment.Horizontal = XLAlignmentHorizontalValues.Center;
            worksheet.Cell(7,2).Value = "IncioPeriodo a FinalPeriodo";
            worksheet.Cell(7,2).Style.Font.Bold = true;
            worksheet.Cell(7,2).Style.Font.FontSize = 16;

            var recordIndex = 10;

            foreach (var project in listaProject)
            {
                
                worksheet.Cell(recordIndex-1,1).Value = "Projeto";
                worksheet.Cell(recordIndex-1,1).Style.Font.FontSize = 14;
                worksheet.Cell(recordIndex-1,1).Style.Font.Bold = true;

                worksheet.Cell(recordIndex-1,2).Value = project;
                worksheet.Cell(recordIndex-1,2).Style.Font.FontSize = 14;
                worksheet.Cell(recordIndex-1,2).Style.Font.Bold = true;

                worksheet.Cell(recordIndex,1).Value = "Projetos";
                worksheet.Cell(recordIndex,1).Style.Font.FontSize = 14;
                worksheet.Cell(recordIndex,1).Style.Font.FontColor = XLColor.White;
                worksheet.Cell(recordIndex,1).Style.Fill.BackgroundColor = XLColor.Black;
                range = worksheet.Range(recordIndex,1,recordIndex,2);
                range.Merge().Style.Alignment.Horizontal = XLAlignmentHorizontalValues.Center;
                

                worksheet.Cell(recordIndex,3).Value = "Vl Hora";
                worksheet.Cell(recordIndex,3).Style.Font.FontSize = 14;
                worksheet.Cell(recordIndex,3).Style.Font.FontColor = XLColor.White;
                worksheet.Cell(recordIndex,3).Style.Fill.BackgroundColor = XLColor.Black;
                worksheet.Cell(recordIndex,3).Style.Alignment.Horizontal = XLAlignmentHorizontalValues.Center;



                worksheet.Cell(recordIndex,4).Value = "Qtd Horas";
                worksheet.Cell(recordIndex,4).Style.Font.FontSize = 14;
                worksheet.Cell(recordIndex,4).Style.Font.FontColor = XLColor.White;
                worksheet.Cell(recordIndex,4).Style.Fill.BackgroundColor = XLColor.Black;
                worksheet.Cell(recordIndex,4).Style.Alignment.Horizontal = XLAlignmentHorizontalValues.Center;


                worksheet.Cell(recordIndex,5).Value = "Vl Total";
                worksheet.Cell(recordIndex,5).Style.Font.FontSize = 14;
                worksheet.Cell(recordIndex,5).Style.Font.FontColor = XLColor.White;
                worksheet.Cell(recordIndex,5).Style.Fill.BackgroundColor = XLColor.Black;
                worksheet.Cell(recordIndex,5).Style.Alignment.Horizontal = XLAlignmentHorizontalValues.Center;


                foreach (var dado in relatorios.Where(x => x.Project == project))
                {
                    recordIndex++;

                    worksheet.Cell(recordIndex,1).Value = $"{dado.Role} {dado.RoleSeniority}";
                    worksheet.Cell(recordIndex,1).Style.Fill.BackgroundColor = XLColor.FromArgb(217,217,217);
                    range = worksheet.Range(recordIndex,1,recordIndex,2);
                    range.Merge().Style.Font.FontSize = 14;

                    worksheet.Cell(recordIndex,3).Value = "20.00";
                    worksheet.Cell(recordIndex,3).Style.Font.FontSize = 14;
                    worksheet.Cell(recordIndex,3).Style.Fill.BackgroundColor = XLColor.FromArgb(217,217,217);
                    worksheet.Cell(recordIndex,3).Style.NumberFormat.Format = "R$ #,##0.00";
                    worksheet.Cell(recordIndex,3).DataType = XLDataType.Number;



                    worksheet.Cell(recordIndex,4).Value = dado.WorkHours;
                    worksheet.Cell(recordIndex,4).Style.Font.FontSize = 14;
                    worksheet.Cell(recordIndex,4).Style.Fill.BackgroundColor = XLColor.FromArgb(217,217,217);
                    worksheet.Cell(recordIndex,4).Style.NumberFormat.Format = "0.00";

                    projectHours += dado.WorkHours;


                    worksheet.Cell(recordIndex,5).Value = dado.TotalValue;    
                    worksheet.Cell(recordIndex,5).Style.Font.FontSize = 14;
                    worksheet.Cell(recordIndex,5).Style.Fill.BackgroundColor = XLColor.FromArgb(217,217,217);
                    worksheet.Cell(recordIndex,5).Style.NumberFormat.Format = "R$ #,##0.00";
                    worksheet.Cell(recordIndex,5).DataType = XLDataType.Number;

                    projectValue += dado.TotalValue;
                }

                worksheet.Cell(recordIndex+1,1).Value = "Total do Projeto";
                worksheet.Cell(recordIndex+1,1).Style.Font.Bold = true;

                range = worksheet.Range(recordIndex+1,1,recordIndex+1,2);
                range.Merge().Style.Font.FontSize = 14;
                worksheet.Cell(recordIndex+1,1).Style.Fill.BackgroundColor = XLColor.FromArgb(217,217,217);

                worksheet.Cell(recordIndex+1,3).Value = "";
                worksheet.Cell(recordIndex+1,3).Style.Fill.BackgroundColor = XLColor.FromArgb(217,217,217);

                worksheet.Cell(recordIndex+1,4).Value = projectHours;
                worksheet.Cell(recordIndex+1,4).Style.Font.FontSize = 14;
                worksheet.Cell(recordIndex+1,4).Style.Font.Bold = true;
                worksheet.Cell(recordIndex+1,4).Style.NumberFormat.Format = "0.00";

                worksheet.Cell(recordIndex+1,4).Style.Fill.BackgroundColor = XLColor.FromArgb(217,217,217);
                
                worksheet.Cell(recordIndex+1,5).Value = projectValue;
                worksheet.Cell(recordIndex+1,5).Style.Font.FontSize = 14;
                worksheet.Cell(recordIndex+1,5).Style.Font.Bold = true;
                worksheet.Cell(recordIndex+1,5).Style.NumberFormat.Format = "R$ #,##0.00";
                worksheet.Cell(recordIndex+1,5).DataType = XLDataType.Number;

                worksheet.Cell(recordIndex+1,5).Style.Fill.BackgroundColor = XLColor.FromArgb(217,217,217);

                totalValue += projectValue;

                projectHours = 0;
                projectValue = 0;
                recordIndex = recordIndex + 5;
            }
            worksheet.Cell(recordIndex, 1).Value = "Total";
            worksheet.Cell(recordIndex, 1).Style.Font.Bold = true;
            worksheet.Cell(recordIndex, 1).Style.Fill.BackgroundColor = XLColor.Black;
            worksheet.Cell(recordIndex, 1).Style.Font.FontColor = XLColor.White;
            worksheet.Cell(recordIndex, 1).Style.Font.FontSize = 14;
            range = worksheet.Range(recordIndex,1,recordIndex,4);
            range.Merge().Style.Alignment.Horizontal = XLAlignmentHorizontalValues.Center;


            worksheet.Cell(recordIndex, 5).Value = totalValue;
            worksheet.Cell(recordIndex, 5).Style.Font.Bold = true;
            worksheet.Cell(recordIndex, 5).Style.Fill.BackgroundColor = XLColor.Black;
            worksheet.Cell(recordIndex, 5).Style.Font.FontColor = XLColor.White;
            worksheet.Cell(recordIndex, 5).Style.Font.FontSize = 14;
            worksheet.Cell(recordIndex,5).Style.NumberFormat.Format = "R$ #,##0.00";

            
            //Ajustando o tamanho da coluna para os valores.
            worksheet.Columns().AdjustToContents();

            /* Protegendo planilha se necessario */
            // var protection = worksheet.Protect("Code123@");
            // protection.AllowedElements = XLSheetProtectionElements.InsertRows |
            //                             XLSheetProtectionElements.InsertColumns;
                

            string path = @"./File/teste.xlsx";
            workbook.SaveAs(path);
            // Process.Start(new ProcessStartInfo(@"./File/teste.xlsx"){UseShellExecute = true});

            
        } 
    }
}
